    useEffect(()=>{
        function getTeachers (){
            axios.get("http://localhost:8070/teacher/").then((res)=>{
                getTeachers(res.data);
            }).catch((err)=>{
                alert(err.message);
            })
        }
        getTeachers();
    

    },[])

   
   
